import React, {useState,Fragment} from 'react';
import styled from 'styled-components';
import Card from './Card.jsx' 
import Drip from '../images/css.png'

const Container = styled.div`
padding:0px;
height:100%;
`

const Flexed = styled.div`
display:flex;
flex-direction:row;
justify-content: center;
margin: 0 auto;
width: 100%;
@media(max-width:425px){
      flex-direction:column  ;
      justify-content: center;
      margin:0 auto;
  }
@media(min-width:426px) and (max-width:786px){
     flex-direction:row  ;
  flex-wrap: wrap;
    justify-content: center;
    margin:0 auto;
}
`

function Parallax() {

  const [State] = useState([
    {name:"Full Wedding Planning Experience R15 000 +", message:"This package is for the couple who needs my assistance in planning their wedding from start to finish, absolutely EVERYTHING!!",message2:"This package includes co-ordination with third party suppliers and any additional necessary events leading up to the wedding day including the on the day coordination of wedding", img:Drip,  alt:"image"},

    {name:"A", message:"Lorem ipsum dolor sit amet consectetur adipisicing elit. Natus iste maiores hic! Aspernatur neque eos ullam quis cum placeat libero. Ad pariatur quibusdam doloribus ut, commodi non error inventore quidem?", img:Drip,  alt:"image"},

    {name:"H", message:"Lorem ipsum dolor sit amet consectetur adipisicing elit. Natus iste maiores hic! Aspernatur neque eos ullam quis cum placeat libero. Ad pariatur quibusdam doloribus ut, commodi non error inventore quidem?", img:Drip,  alt:"image"},

  ]);



return(
   <div className="row">
        <Container  id="Skills">

            <Flexed >

            <Fragment>
            {State.map((data, index) => (
            <Card key={index} name={data.name} message={data.message} message2={data.message2} img={data.img} Link={data.Link}  alt={data.alt}/>))}
           </Fragment>

           </Flexed>

        </Container>
        </div>
  );
}

export default Parallax;
